import React, { Component } from 'react'

export default class Intro extends Component {
  render() {
    return (
      <div className="intro">
        <img className="spotify" src="/Assets/Spotify_Logo_RGB_Green.png"></img>
        <img className="microsoft" src="/Assets/2000px-Microsoft_logo_(2012).svg.png"></img>
      </div>
    )
  }
}
